import React from "react";
import { TileList } from "../tileList/TileList";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit,
  contacts,
  isDuplicate,
  setIsDuplicate
}) => {
  return (
    <TileList contacts={contacts} />
  );
};
